  private func update() {
    let detailAreaViewIsHidden = detailAreaView.isHidden
    let dividerViewIsHidden = dividerView.isHidden
    let filterContainerViewIsHidden = filterContainerView.isHidden
    let filterDividerViewIsHidden = filterDividerView.isHidden
    let searchAreaViewIsHidden = searchAreaView.isHidden
    let suggestionAreaViewIsHidden = suggestionAreaView.isHidden
    let suggestionListContainerViewIsHidden = suggestionListContainerView.isHidden
    let vDividerViewIsHidden = vDividerView.isHidden

    dividerView.isHidden = !true
    filterAllView.isActive = false
    filterRecommendedView.isActive = false
    vDividerView.isHidden = !false
    suggestionAreaView.isHidden = !showsSuggestionArea
    searchAreaView.isHidden = !showsSearchBar
    suggestionSearchBarView.showsOverflowMenu = showsOverflowMenu
    if false == showsSuggestionArea {
      dividerView.isHidden = !false
    }
    if false == showsSearchBar {
      dividerView.isHidden = !false
    }
    suggestionListContainerView.isHidden = !showsSuggestionList
    detailAreaView.isHidden = !showsSuggestionDetails
    if showsSuggestionList {
      vDividerView.isHidden = !true
    }
    if showsSuggestionDetails {
      vDividerView.isHidden = !true
    }
    filterContainerView.isHidden = !showsFilterBar
    filterDividerView.isHidden = !showsFilterBar
    suggestionSearchBarView.onChangeSearchText = handleOnChangeSearchText
    suggestionSearchBarView.searchText = searchText
    suggestionSearchBarView.placeholderText = placeholderText
    suggestionSearchBarView.onPressDownKey = handleOnPressDownKey
    suggestionSearchBarView.onPressUpKey = handleOnPressUpKey
    suggestionListViewView.selectedIndex = selectedIndex
    suggestionListViewView.onSelectIndex = handleOnSelectIndex
    suggestionListViewView.onActivateIndex = handleOnActivateIndex
    suggestionSearchBarView.onSubmit = handleOnSubmit
    suggestionSearchBarView.onPressEscapeKey = handleOnPressEscapeKey
    suggestionSearchBarView.onPressTabKey = handleOnPressTabKey
    suggestionSearchBarView.onPressShiftTabKey = handleOnPressShiftTabKey
    suggestionSearchBarView.onSelectDropdownIndex = handleOnSelectDropdownIndex
    suggestionSearchBarView.showsDropdown = showsDropdown
    suggestionSearchBarView.dropdownValues = dropdownValues
    suggestionSearchBarView.dropdownKeyEquivalents = dropdownKeyEquivalents
    suggestionSearchBarView.dropdownIndex = dropdownIndex
    suggestionSearchBarView.onHighlightDropdownIndex = handleOnHighlightDropdownIndex
    suggestionSearchBarView.onCloseDropdown = handleOnCloseDropdown
    suggestionSearchBarView.onOpenDropdown = handleOnOpenDropdown
    suggestionDetailViewView.detailView = detailView
    suggestionSearchBarView.onPressCommandDownKey = handleOnPressCommandDownKey
    suggestionSearchBarView.onPressCommandUpKey = handleOnPressCommandUpKey
    filterAllView.onClick = handleOnPressFilterAll
    filterRecommendedView.onClick = handleOnPressFilterRecommended
    suggestionSearchBarView.onPressOverflowMenu = handleOnPressOverflowMenu
    suggestionListContainerViewWidthAnchorConstraint?.constant = suggestionListWidth
    if suggestionFilter == .recommended {
      filterRecommendedView.isActive = true
    }
    if suggestionFilter == .all {
      filterAllView.isActive = true
    }

    if
    detailAreaView.isHidden != detailAreaViewIsHidden ||
      dividerView.isHidden != dividerViewIsHidden ||
        filterContainerView.isHidden != filterContainerViewIsHidden ||
          filterDividerView.isHidden != filterDividerViewIsHidden ||
            searchAreaView.isHidden != searchAreaViewIsHidden ||
              suggestionAreaView.isHidden != suggestionAreaViewIsHidden ||
                suggestionListContainerView.isHidden != suggestionListContainerViewIsHidden ||
                  vDividerView.isHidden != vDividerViewIsHidden
    {
      NSLayoutConstraint.deactivate(
        conditionalConstraints(
          detailAreaViewIsHidden: detailAreaViewIsHidden,
          dividerViewIsHidden: dividerViewIsHidden,
          filterContainerViewIsHidden: filterContainerViewIsHidden,
          filterDividerViewIsHidden: filterDividerViewIsHidden,
          searchAreaViewIsHidden: searchAreaViewIsHidden,
          suggestionAreaViewIsHidden: suggestionAreaViewIsHidden,
          suggestionListContainerViewIsHidden: suggestionListContainerViewIsHidden,
          vDividerViewIsHidden: vDividerViewIsHidden))
      NSLayoutConstraint.activate(
        conditionalConstraints(
          detailAreaViewIsHidden: detailAreaView.isHidden,
          dividerViewIsHidden: dividerView.isHidden,
          filterContainerViewIsHidden: filterContainerView.isHidden,
          filterDividerViewIsHidden: filterDividerView.isHidden,
          searchAreaViewIsHidden: searchAreaView.isHidden,
          suggestionAreaViewIsHidden: suggestionAreaView.isHidden,
          suggestionListContainerViewIsHidden: suggestionListContainerView.isHidden,
          vDividerViewIsHidden: vDividerView.isHidden))
    }
  }

